import React from "react";

import { Spacer } from "../../../components/spacer/spacer.component";
import {
  AccountBackground,
  AccountContainer,
  AccountCover,
  AuthButton,
  Title,
  AnimationWrapper,
  ButtonsContainer,
  AuthButtonInverted,
} from "../components/account.styles";
import { SafeArea } from "../../../components/utility/safe-area.component";

export const AccountScreen = ({ navigation }) => {
  return (
    <SafeArea>
      <AccountBackground style={{ paddingBottom: "4%" }}>
        <AccountCover />
        <AccountContainer>
          <Title>CraftSeeker</Title>
          <ButtonsContainer
            style={{ alignSelf: "center", bottom: "20%", position: "absolute" }}
          >
            <AuthButton
              icon="lock-open-outline"
              mode="contained"
              onPress={() => navigation.navigate("Login")}
            >
              Login
            </AuthButton>
            <Spacer size="large">
              <AuthButtonInverted
                icon="email"
                mode="contained"
                onPress={() => navigation.navigate("Register")}
              >
                Register
              </AuthButtonInverted>
            </Spacer>
          </ButtonsContainer>
          <Spacer size="medium" />
        </AccountContainer>
      </AccountBackground>
    </SafeArea>
  );
};
